async function sendTextMessageToDialogFlow(textMessage, sessionId) {
  // Define session path
  const sessionPath = sessionClient.sessionPath(projectId, sessionId);
  // The text query request.
  const request = {
    session: sessionPath,
    queryInput: {
      text: {
        text: textMessage,
        languageCode: LANGUAGE_CODE
      }
    }
  }
  try {
    let responses = await sessionClient.detectIntent(request);
    console.log('DialogFlow.sendTextMessageToDialogFlow: Detected intent', responses);
    return responses;
  } catch (err) {
    console.error('DialogFlow.sendTextMessageToDialogFlow ERROR:', err);
    throw err
  }
};




console.log("Defining what the bot should do when messaged...");
bot.on("message", async message => {
  if (message.author.bot) return;
  if (message.author.system) return;
  if (message.content.indexOf(conf.prefix) !== 0) return;
  var query = message.content.substr(7)
  console.log(`Message recieved, from '${message.author.username}' (ID:${message.author.id}): "${query}"`);
  let returns = sendTextMessageToDialogFlow(query, guid());
  returns.then((value) => {
    let fulfillment = value[0].queryResult.fulfillmentText;
    message.channel.send(fulfillment);
  });



});

